function isEmpty(el,text){
    //var el = document.getElementById(id);
    var str = el.value;
    if (str != "")
        while (str.charAt(0) == " ")
            str = str.substr(1, str.length);
    //return str == "" ? true : false;
    if(str != "") return false;
    if(typeof(text) != 'undefined') alert(text);
    el.value = '';
    el.focus();
    return true;
}
function isNumber(el, text){
    //var el = document.getElementById(id);
    var str = "0123456789";
    for(var j=0; j < el.value.length; j++){
        if(str.indexOf(el.value.charAt(j))==-1){
            if( typeof(text) != 'undefined' )
                alert(text);
            el.value = '';
            el.focus(); 
            return false;
        }
    }
    return true;
}
function isPhone(str,text){ 
    if((str.length==10 && (str.substr(0,2)==08)) || (str.length==10 && (str.substr(0,2)==09)) || (str.length==10 && (str.substr(0,2)==07)) || (str.length==10 && (str.substr(0,2)==05)) || (str.length==10 && (str.substr(0,2)==03)))
        return true;
    if(typeof(text)!='undefined') alert(text);
}
function check_email(email)
{
    emailRegExp = /^[_a-z0-9-]+(\.[_a-z0-9-]+)*@[a-z0-9-]+(\.[a-z0-9-]+)*(\.([a-z]){2,4})$/;
    return emailRegExp.test(email);
}
function isEmail(el, text){
    //var el = document.getElementById(id);
    emailRegExp = /^[_a-z0-9-]+(\.[_a-z0-9-]+)*@[a-z0-9-]+(\.[a-z0-9-]+)*(\.([a-z]){2,4})$/;
    if(!emailRegExp.test(el.value)){
        if(typeof(text)!='undefined')   alert(text);
        el.focus();
        return false;
    }
    return true;
}
function isEmail_2(s){   
  if (s=="") return true;//false;
  if(s.indexOf(" ")>0) return false;
  if(s.indexOf("@")==-1) return false;
  var i = 1;
  var sLength = s.length;
  if (s.indexOf(".")==-1) return false;
  if (s.indexOf("..")!=-1) return false;
  if (s.indexOf("@")!=s.lastIndexOf("@")) return false;
  if (s.lastIndexOf(".")==s.length-1) return false;
  var str="abcdefghikjlmnopqrstuvwxyz-@._"; 
  for(var j=0;j<s.length;j++)
    if(str.indexOf(s.charAt(j))==-1)
        return false;
    return true;
}
function compare(value_1, value_2){
    if(value_1 < value_2)
        return -1;
    if(value_1 > value_2)
        return 1;
    return 0;
}
